var title_f18_62_19436="Common developmental milestones";
var content_f18_62_19436=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F70142&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F70142&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Common developmental milestones",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Milestone",
"       </td>",
"       <td class=\"subtitle1\">",
"        Age at acquisition",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fixes gaze briefly, habituates to stereotyped auditory, visual, and tactile stimuli",
"       </td>",
"       <td>",
"        At birth (40 weeks post conceptional age)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Smiles responsively, gurgles",
"       </td>",
"       <td>",
"        2-3 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Visual tracking of a bright object to 180 degrees",
"       </td>",
"       <td>",
"        3 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rolls over, holds head upright when pulled from supine to sitting",
"       </td>",
"       <td>",
"        3 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Reaches out for objects",
"       </td>",
"       <td>",
"        4-5 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Maintains sitting position independently",
"       </td>",
"       <td>",
"        6 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Grasps objects using thumb and index finger pulp",
"       </td>",
"       <td>",
"        8-9 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Crawls, babbles, uses non-specific \"Mama\", \"Dada\" sounds",
"       </td>",
"       <td>",
"        9-10 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pulls up to stand and walks with support",
"       </td>",
"       <td>",
"        10-11 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Walks independently, uses 2-3 clear words, including specific \"Mama\" and \"Dada\"",
"       </td>",
"       <td>",
"        13-14 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Can point to body parts, use simple phrases",
"       </td>",
"       <td>",
"        18-19 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Names body parts, states age, uses phrases",
"       </td>",
"       <td>",
"        24 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pedals tricycle, speaks in sentences, asks questions, likely toilet trained, can name primary colors",
"       </td>",
"       <td>",
"        36 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Masters concepts of alphabets and numbers",
"       </td>",
"       <td>",
"        4-5 years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Able to read simple words, add, subtract",
"       </td>",
"       <td>",
"        5-6 years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Concepts of division, multiplication, geography, general information like cities, states, large rivers, oceans, etc.",
"       </td>",
"       <td>",
"        7-8 years",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Suresh Kotagal.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
