" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Dietary recommendations for school-age children to adolescents",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Food groups and number of servings",
"       </td>",
"       <td class=\"subtitle1\">",
"        Age 9 to 13 years",
"       </td>",
"       <td class=\"subtitle1\">",
"        Age 14 to 18 years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Milk and milk products",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Low-fat or fat-free milk or milk products",
"        </em>",
"       </td>",
"       <td>",
"        3 cups/day",
"       </td>",
"       <td>",
"        3 cups/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" colspan=\"2\">",
"        <p>",
"         1 cup equivalent =",
"        </p>",
"        <p>",
"         1 cup of milk or yogurt, 1&frac12; ounces of a natural cheese, 2 ounces of processed cheese, 1/3 cup of shredded cheese",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Meat and other protein foods",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Includes beef, chicken, pork, poultry, fish, eggs, peanut butter, and legumes",
"        </em>",
"       </td>",
"       <td>",
"        5 ounces/day",
"       </td>",
"       <td>",
"        5 to 6 ounces/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" colspan=\"2\">",
"        <p>",
"         1 ounce equivalent =",
"        </p>",
"        <p>",
"         1 ounce of beef, poultry or fish, &frac14; cup cooked beans, 1 egg, 1 tablespoon peanut butter, &frac12; ounce of nuts",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Breads, cereals, and starches",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Includes whole-grain breads, infant and cooked cereals, rice, pasta, ready to eat cereals. Half of all starches should be whole grains.",
"        </em>",
"       </td>",
"       <td>",
"        5 to 6 ounces/day",
"       </td>",
"       <td>",
"        6 to 7 ounces/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" colspan=\"2\">",
"        <p>",
"         1 ounce equivalent =",
"        </p>",
"        <p>",
"         1 slice whole-grain bread, &frac12; cup cooked cereal, rice, or pasta, 1 cup dry cereal",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Fruits",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Includes one source of vitamin C daily (citrus fruits and juices, strawberries) and one source of vitamin A every other day (dark green and yellow fruits, melons)",
"        </em>",
"       </td>",
"       <td>",
"        1&frac12; cups/day",
"       </td>",
"       <td>",
"        1&frac12; to 2 cups/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" colspan=\"2\">",
"        <p>",
"         1 cup equivalent =",
"        </p>",
"        <p>",
"         1 cup of fruit or 100 percent fruit juice*, &frac12; cup of dried fruit",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Vegetables",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Includes one source of vitamin C daily (broccoli and tomatoes) and one source of vitamin A every other day (spinach, sweet potatoes, corn, squash)",
"        </em>",
"       </td>",
"       <td>",
"        2 to 2&frac12; cups/day",
"       </td>",
"       <td>",
"        2&frac12; to 3 cups/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" colspan=\"2\">",
"        <p>",
"         1 cup equivalent =",
"        </p>",
"        <p>",
"         1 cup of raw or cooked vegetables or vegetable juice, 2 cups of raw leafy greens",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Fats and oils",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Includes margarine, butter, oils",
"        </em>",
"       </td>",
"       <td>",
"        5 teaspoons/day",
"       </td>",
"       <td>",
"        5 to 6 teaspoons/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\" colspan=\"2\">",
"        <p>",
"         1 teaspoon equivalent =",
"        </p>",
"        <p>",
"         1 teaspoon oil, margarine, butter or mayonnaise, 1 tablespoon salad dressing, sour cream or light mayonnaise",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Miscellaneous",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"3\">",
"        <em>",
"         Desserts, sweets, soft drinks, candy, jams and jelly",
"        </em>",
"       </td>",
"       <td colspan=\"2\">",
"        Limit to small amount, use sparingly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Discretionary calories",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        130 to 410",
"       </td>",
"       <td>",
"        265 to 650",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    NOTE: For more details, go to",
"    <a href=\"file://www.myplate.gov\">",
"     www.myplate.gov",
"    </a>",
"    .",
"    <div class=\"footnotes\">",
"     * Children should be encouraged to consume whole fruits. Recommended to limit fruit juice to 8 to 12 ounces for children 7 to 18 years of age.",
"    </div>",
